import React, {useEffect, Fragment} from 'react'
import PropTypes from 'prop-types'
import { Card, Button} from 'react-bootstrap';
import '.././css/article.css'
import '.././css/card.css'

const Article = ({article}) => {
    useEffect(()=> {
        console.log(article)
    }, [])

    return (
        <div className="col-md-6 col-xs-6">
            <Card style={{ width: '400px' }}>
                <Card.Body>
                    <Card.Title className="title">{article.title}</Card.Title>
                    <Card.Img variant="top" src={`${article.image}`} />
                    <Card.Text className="subtitle">{article.subtitle}</Card.Text>
                    <Card.Text className="time">{article.time}</Card.Text>
                    <Card.Text className="readtime">{article.readtime}</Card.Text>
                    <Button className="article-btn" variant="primary">Check</Button>
                </Card.Body>
            </Card>
        </div>

    )
}

Article.propTypes = {
    article: PropTypes.object.isRequired
}

export default Article
